parts.text:
{
  "events": [
    {
      "offset_seconds": 0,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Who is this?"
    },
    {
      "offset_seconds": 1.5,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Do you want to make it smaller?"
    },
    {
      "offset_seconds": 2,
      "event_type": "mouse",
      "action": "click",
      "target_desc": "MobyMax icon",
      "details": "Student clicks the MobyMax icon on the Clever portal."
    },
    {
      "offset_seconds": 4,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Yeah. Oh, that's small. No no no no no let me see let me see."
    },
    {
      "offset_seconds": 7,
      "event_type": "view_change",
      "description": "MobyMax loading",
      "details": "Student is redirected to MobyMax landing page."
    },
    {
      "offset_seconds": 8,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "It's just so awkward. Oh, they're asking you to go to breakout. You click join room."
    },
    {
      "offset_seconds": 12,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Okay, that's small enough. Okay there."
    },
    {
      "offset_seconds": 14,
      "event_type": "mouse",
      "action": "click",
      "target_desc": "Math button",
      "details": "Student clicks the large 'Math' button in MobyMax."
    },
    {
      "offset_seconds": 16,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Awesome. How are you doing today?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 17,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Man how come I don't have a teacher?"
    },
    {
      "offset_seconds": 18,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Uh, good.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 19,
      "event_type": "view_change",
      "description": "MobyMax Math Page",
      "details": "A loading screen with a sunset graphic appears."
    },
    {
      "offset_seconds": 21,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "What do I do?"
    },
    {
      "offset_seconds": 23,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "What are you working on right now?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 25,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Math.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 26,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Do I share my screen?"
    },
    {
      "offset_seconds": 28,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Do you know what in math you're working on right now?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 31,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Um, ratios.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 33,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Awesome.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 34,
      "event_type": "view_change",
      "description": "Lesson Content",
      "details": "MobyMax displays a lesson on 'A rate is a type of ratio'."
    },
    {
      "offset_seconds": 35,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Do I share my screen?"
    },
    {
      "offset_seconds": 37,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Alright, well go ahead and get started. I'll check back in with you in a little bit, okay?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 41,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Okay.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 43,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Alright.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 46,
      "event_type": "mouse",
      "action": "click",
      "target_desc": "Next Arrow",
      "details": "Student clicks the green arrow to proceed."
    },
    {
      "offset_seconds": 47,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "You can begin now."
    },
    {
      "offset_seconds": 48,
      "event_type": "view_change",
      "description": "Stop Share",
      "details": "The screen sharing ends. The view switches to the tutor's video feed."
    },
    {
      "offset_seconds": 53,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Hey Adonai, can you hear me okay?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 60,
      "event_type": "inactivity",
      "duration_seconds": 50,
      "description": "Tutor waits silently, looking at the screen."
    },
    {
      "offset_seconds": 111,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Hey Adonai, can you hear me?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 115,
      "event_type": "inactivity",
      "duration_seconds": 21,
      "description": "Tutor waits for a response."
    },
    {
      "offset_seconds": 136,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Hey Adonai, can you hear me?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 140,
      "event_type": "inactivity",
      "duration_seconds": 59,
      "description": "Tutor waits, looking concerned or confused."
    },
    {
      "offset_seconds": 199,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Hey Adonai, can you hear me?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 204,
      "event_type": "inactivity",
      "duration_seconds": 108,
      "description": "Long period of inactivity. Tutor is waiting."
    },
    {
      "offset_seconds": 312,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Hey Adonai, can you hear me?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 315,
      "event_type": "inactivity",
      "duration_seconds": 106,
      "description": "Tutor continues to wait."
    },
    {
      "offset_seconds": 421,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Hi Adonai, can you hear me?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 425,
      "event_type": "inactivity",
      "duration_seconds": 15,
      "description": "Tutor waits."
    },
    {
      "offset_seconds": 440,
      "event_type": "view_change",
      "description": "Cat appears",
      "details": "A cat walks into the frame and the tutor interacts with it."
    },
    {
      "offset_seconds": 540,
      "event_type": "view_change",
      "description": "Screen Share Resumes",
      "details": "The student (Winola) starts sharing their screen again showing MobyMax."
    },
    {
      "offset_seconds": 541,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "I don't know."
    },
    {
      "offset_seconds": 542,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Hey Winola! How's it going?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 544,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Good.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 545,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Good.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 547,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Go ahead and keep working, I'll just be here while you work if you have any questions.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 550,
      "event_type": "mouse",
      "action": "move",
      "target_desc": "Text box",
      "details": "Student moves cursor to the answer box."
    },
    {
      "offset_seconds": 551,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Okay.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 554,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Do they want you to talk to them?"
    },
    {
      "offset_seconds": 556,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "I guess I'll just do it."
    },
    {
      "offset_seconds": 560,
      "event_type": "inactivity",
      "duration_seconds": 40,
      "description": "Student is presumably working on the problem. Screen shows the question: 'A Ferrari drove 300 kilometers in one and a half hours. How fast was the car going?'"
    },
    {
      "offset_seconds": 600,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "I have to use my whiteboard."
    },
    {
      "offset_seconds": 602,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Just... don't let them see it."
    },
    {
      "offset_seconds": 607,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Just tell them."
    },
    {
      "offset_seconds": 610,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Can you turn your camera on for me? That way you can show me your whiteboard?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 615,
      "event_type": "view_change",
      "description": "Video layout change",
      "details": "Tutor minimizes her video window."
    },
    {
      "offset_seconds": 616,
      "event_type": "view_change",
      "description": "Student Camera On",
      "details": "The student turns on her camera. The screen share view minimizes."
    },
    {
      "offset_seconds": 617,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "No, my person left me. I don't know where they went."
    },
    {
      "offset_seconds": 622,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Okay.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 626,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Can you see my room?",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 629,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "English?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 630,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Math."
    },
    {
      "offset_seconds": 632,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Yes.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 634,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "So what's the problem?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 636,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Yes but I don't know how to run it."
    },
    {
      "offset_seconds": 639,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Um.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 643,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "300."
    },
    {
      "offset_seconds": 646,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "300."
    },
    {
      "offset_seconds": 647,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Oh, or..."
    },
    {
      "offset_seconds": 649,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "I'll do it closer.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 651,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "You can just write it first and then hold it up and show me, that works too.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 657,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Or you write 90."
    },
    {
      "offset_seconds": 659,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Are you sure? Just check first."
    },
    {
      "offset_seconds": 699,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "How come I don't have a teacher?"
    },
    {
      "offset_seconds": 703,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Um...",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 707,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "One and a half... so that's 90, right?",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 710,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "90 minutes, yeah.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 713,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Oh, 90...",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 716,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Equals...",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 720,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Oh for..."
    },
    {
      "offset_seconds": 730,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "So let's go back, let's go back to the question real quick.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 732,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Oh you're not..."
    },
    {
      "offset_seconds": 737,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Okay.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 739,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "So...",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 740,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "It drove 300 kilometers in one and a half hours right? You said that was 90.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 747,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "What, what did you mean when you said 90?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 750,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Um because it says one and a half.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 753,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "One and a half hours right? So it's 90 what?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 757,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "One and a half hours is the same as 90 what?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 760,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "Oh you think you know? You think you know?",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 803,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Um... 90...",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 807,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Minutes.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 808,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "90 minutes.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 810,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Yeah, your friend over there is right.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 813,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "So...",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 815,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "We, we know the car drove 300 kilometers in 90 minutes. So...",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 821,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "We want to know how fast it drove per hour, right?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 824,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Yep.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 826,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Okay so we want to keep the same unit time on the bottom.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 831,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "So because it already gave it to us as...",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 835,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Hours, we can keep it as hours. So we can say one and a half hours.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 840,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "So we could say 300 kilometers over 1.5 hours.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 846,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Does that make sense?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 847,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Okay.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 848,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Yeah.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 851,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "You could turn it into minutes if you wanted to but then we'd have to go back to hours.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 856,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Okay.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 858,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Okay so if you have 300 over 1.5. Have you guys learned how to divide decimals yet?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 905,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Um yeah.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 907,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Okay.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 908,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "So if you divide 300 by 1.5 what does that get you?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 913,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "300 divided by 1.5. That's a lot."
    },
    {
      "offset_seconds": 916,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "Write it out on your whiteboard.",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 918,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Okay.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 923,
      "event_type": "spoken_utterance",
      "speaker_label": "background",
      "text": "300 divided by... 1.5. I have a teacher!"
    },
    {
      "offset_seconds": 927,
      "event_type": "spoken_utterance",
      "speaker_label": "tutor",
      "text": "That'll give you your answer, okay?",
      "speaker_name": "Kristen Lamberton"
    },
    {
      "offset_seconds": 931,
      "event_type": "spoken_utterance",
      "speaker_label": "student",
      "text": "Okay.",
      "speaker_name": "Winola"
    },
    {
      "offset_seconds": 935,
